import environment from '../environments/environment';
import axios from 'axios';

export default class StudentLogin {

  availableServicesSearchUrl = environment.JAVA_API_BASE_URL + '/search';
  headers;

  constructor() {
    this.headers = {
      'Content-Type': 'application/json',
      'Accept': 'application/json',
      'Access-Control-Allow-Origin': '*'
    };
  }


  getAvailableServices = (searchString:string) => {
    return axios.get(this.availableServicesSearchUrl, {
        headers: this.headers,
        params : {'search_string' : searchString}
      })
      .then(this.extractData)
      .catch(this.handleError);
  }
  extractData(res: Response) {
    return res;
  }

  handleError(response: any) {
    console.log(response.error);
    return response.error.errors.errorMessage;
  }



}
